client_script:
frappe.web_form.after_load = async () => {
	await frappe.call({
		method: "juzgo.juzgo.web_form.interview.interview.get_question_fields",
		args: {
			data: decodeURIComponent(window.location.hash?.substr(1))
		}, callback(r) {
    		if (r.message.error) {
    		    frappe.web_form.errorWebform();
    		    return;
    		} else if(r.message.already_response_submitted) {
    		    frappe.web_form.alreadyRespondedWebform();
    		    return;
    		} else if(r.message.form_status == "form-closed") {
    		    frappe.web_form.formNotOpened(
    		        r.message.form_opening_date, 
    		        r.message.form_closing_date, 
    		        r.message.form_opening_time, 
    		        r.message.form_closing_time
    		    );
    		    return;
    		} else if(r.message.form_status == "form-not-opened") {
    		    frappe.web_form.formNotOpened(
    		        r.message.form_opening_date, 
    		        r.message.form_closing_date, 
    		        r.message.form_opening_time, 
    		        r.message.form_closing_time
    		    );
    		    return;
    		}

			frappe.web_form.questions = []
			Object.keys(r.message).forEach(key => {
				if (key == "questions") {
					r.message[key]?.forEach(field => {
						frappe.web_form.questions.push(field);
						frappe.web_form.make_section({});
						frappe.web_form.make_field(field, undefined, 1);
					});
				} else {
					try {
						frappe.web_form.set_value(key, r.message[key] || "");
					} catch {

					}

				}
			});
		}
	});
}
